import React from 'react';
import ProfileCard from '../components/ProfileCard';
import '../styles/Home.css';

const dummyProfiles = 
 [
  {
    id: 1,
    name: 'Ananya Sharma',
    bio: 'Frontend Developer & UI Enthusiast',
    image: 'https://randomuser.me/api/portraits/women/1.jpg',
    fullBio: 'I am passionate about creating intuitive interfaces...',
    workLink: 'https://ananya.dev',
    twitter: 'https://twitter.com/ananyadev',
    instagram: 'https://instagram.com/ananyadev',
    workImages: [
      'https://via.placeholder.com/150',
      'https://via.placeholder.com/150/0000FF',
    ]
  },
  {
    id: 2,
    name: 'Ravi Kumar',
    bio: 'Full Stack Developer',
    image: 'https://randomuser.me/api/portraits/men/2.jpg',
  },
  {
    id: 3,
    name: 'Priya Mehta',
    bio: 'Data Scientist & ML Engineer',
    image: 'https://randomuser.me/api/portraits/women/3.jpg',
  },
  {
    id: 4,
    name: 'Aman Verma',
    bio: 'Backend Engineer',
    image: 'https://randomuser.me/api/portraits/men/4.jpg',
  },
];

const Home = () => {
  return (
    <div className="home-container">
      <h1>Explore Skill Sharers</h1>
      <input
        type="text"
        placeholder="Search by skill, name, or interest..."
        className="search-bar"
      />
      <div className="card-grid">
        {dummyProfiles.map(profile => (
          <ProfileCard key={profile.id} profile={profile} />
        ))}
      </div>
    </div>
  );
};

export default Home;
